svg.script:

function close_eye() {
    document.getElementById('eye_open').style.display = 'none'
    document.getElementById('eye_close').style.display = ''
}
function open_eye() {
    document.getElementById('eye_open').style.display = ''
    document.getElementById('eye_close').style.display = 'none'
}
var wink_started = false
function wink() {
    if(wink_started) return
    wink_started = true
    var t = 300
    open_eye()
    setTimeout(function() {
	close_eye()
	setTimeout(function() {
	    open_eye()
	    setTimeout(function() {
		close_eye()
		setTimeout(function() {
		    open_eye()
		    wink_started = false
		}, t)
	    }, t)
	}, t)
    }, t)
}
